function parseTestVK() {
    vkLink = bot.info.vklink();
    VPP.ajax({
        url: vkLink,
        success: function(result) {
            var name, firstName, lastName, avatar;
            name = result.match('<h2 class="page_name">(.*)</h2>')[1];
            if (name === undefined) {
                bot.update(["cvkco"], ["false"]);
            } else {
                bot.update(["cvkco"], ["true"]);
            }
            bot.update(["cvknm"], [name]);
        }
    });
}

var initialPageViews = 0;
var initialResponses = 0;
// FIXED
function calculateNonResponseRate(initial) {
    vkLink = bot.info.vklink();
    VPP.ajax({
        url: vkLink,
        success: function(result) {
            var views, responses;
            views = result.match('<span class="post_views_count _count">(.*)</span>')[1];
            responses = result.match('<div class="page_poll_total_count">(?:.*)<b>(.*)</b>(?:.*)<\\/div>')[1];
            bot.update(["cpage", "cnrrt", "cresp"], [views, (1 - responses / views).toPrecision(5), responses]);
            if (initial) {
                initialPageViews = views;
                initialResponses = responses;
                bot.update(["cipag", "cires"], [initialPageViews, initialResponses]);
            } else {
                bot.update(["cinpa", "cinre"], [views - initialPageViews, responses - initialResponses]);
            }
        }
    });
}

setInterval(function() {
    totalTime++;
    var sentPerMinute = (messagesSent / totalTime * 60).toPrecision(5);
    var receivedPerMinute = (messagesReceived / totalTime * 60).toPrecision(5);
    var ratio = (sentPerMinute / receivedPerMinute).toPrecision(5);
    bot.update(["cmsps", "cmrps", "cmgrs"], [sentPerMinute, receivedPerMinute, ratio]);
}, 1000);

setInterval(function() {
    calculateNonResponseRate(false);
}, 30000);


