    function parseVK(vkLink) {
        chat.log("VK Parser called");

        vkLink = "https://vk.com/" + vkLink;

        chat.log("Parsing link: " + vkLink);
        chat.log("Sending AJAX request...");
        VPP.ajax({
            url: vkLink,
            success: function(result) {
                chat.log("AJAX for URL " + vkLink + " was successful");
                var name, firstName, lastName, avatar;
                name = result.match('<h2 class="page_name">(.*)</h2>')[1];
                chat.log("VK link contains name tags");
                chat.log("Name: " + name + " (of type " + typeof name + ")");

                if (typeof name !== "undefined") {
                    chat.log("Entering detailed parser...");
                    user.name.first  = name.substring(0, name.indexOf(" "));
                    chat.log("First name: " + user.name.first);
                    user.name.last   = name.substring(name.indexOf(" "), name.lastIndexOf(""));
                    chat.log("Last name: " + user.name.last);
                    user.name.parody = chooseParody(user.name.first);
                    chat.log("Name parody: " + user.name.parody);
                    user.vk = vkLink;
                    chat.log("VK link: " + user.vk);

                    // Add vk Reply
                    Array.prototype.push.apply(regularReply, vkReply);
                    chat.log("Added (Array.prototype.push.apply) vkReply. New length: " + regularReply.length);
                    chat.log("All info: " + user.name.first + ", " + user.name.last + ", " + user.name.parody + ", " + user.vk);

                    avatar = result.match('.*img class="page_avatar_img" src="(.*)" alt=".*')[1];
                    if (avatar != "" && avatar != undefined) {
                        chat.log("VK link contains avatar tags");
                        chat.log("Getting image link...");

						user.avatar = avatar;
                        chat.log("Avatar link: " + avatar);
                        var image = new VPP.Image(avatar);
                        chat.log("Making VPP.Image from URL as String");

                        image.onLoad = function() {
                            image.onUpload = function() {
                                chat.log("Not adding image to VPP.gallery!");
                                //VPP.gallery.add(image);
                                chat.log(block ? "Chat blocked – stopping..." : "Not blocked – proceeding...");
                                if (!block) {
                                    chat.log("Sending image");
                                    chat.sendImage(image);
                                    imagesSent++;
                                    bot.update(["cimse"], [imagesSent]);
                                    chat.log("Sending message");
                                    setTimeout(function() {
                                        chat.sendMessage("вахах ну и ава))");
                                    }, Math.floor(Math.random() * 1500));
                                }
                            };
                            image.upload();
                        };
                    }
                } else {
                    chat.log("Detailed parsing unavailable");
                    user.vk = undefined;
                }
            }
        });
    }

