    function isRepeating(str) {
        var limitation = 5;
        if (str.toLowerCase() != "да" && str.toLowerCase() != "нет" && !block) {
            if (str == previousInput && str == history.received[history.received.length - 3]) {
                chat.log("Input matches previous input twice");
                behavior.becomeAngry(58);
                repeated++;
                output=initialCap(encrypt(repetition.input[Math.floor(Math.random() * repetition.input.length)]));
            } else {
                if (str == previousOutput || str == encrypt(previousOutput)) {
                    chat.log("Input matches previous output");
                    behavior.becomeAngry(44);
                    repeated++;
                    output=initialCap(encrypt(repetition.output[Math.floor(Math.random() * repetition.output.length)]));
                }
            }
        }
        if (repeated >= limitation) {
            chat.log(limitation + " repeated entries");
            chat.sendMessage("зб ты только и делаеш что повторяеш");
            block = true;
            closeChat(750);
        }
    }

