    function roundCurrentTime() {
        hours = getCurrentTime().getHours();
        minutes = getCurrentTime().getMinutes();
        if (!(minutes >= 0 && minutes <= 42)) {
            hours += 1;
            if (hours == 24) {
                hours = 12;
            }
        }
        if (hours == 0) {
            hours = 12;
        }
        switch (hours) {
            case 1:case 21:
                timee = "час";
                break;
            case 2:case 3:case 4:case 22:case 23:
                timee = "часа";
                break;
            default:
                timee = "часов";
        }
        return hours;
    }

    // Updated Feb 8, 2017
    function getCurrentTime() {
        var date = new Date();
        var localTime = date.getTime();
        var localOffset = date.getTimezoneOffset() * 60000;
        var UTC = localTime + localOffset;
        var UTCOffset = 3;
        var moscow = UTC + (3600000 * UTCOffset);
        var specifiedDate = new Date(moscow);
        return specifiedDate;
    }

