    function random_irange(minimal, range) {
        return Math.floor(Math.random() * range) + minimal;
    }

    function random_choose(str) {
        return str[random_irange(0, str.length)];
    }

    function random_time(minHour, maxHour) {
        var hour = random_irange(minHour, maxHour);
        var minutes = random_irange(0, 59);
        if (minutes < 10) {
            minutes = "0" + minutes;
        }
        return hour + ":" + minutes;
    }

    function modify(message) {
        var regex = /\$random_irange\(([0-9]+),(?:\s*)([0-9]+)\)/gi;
        var regexExec = (regex.exec(message));
        if (regexExec) {
            if (regexExec.length === 3) {
                var minimal = parseInt(regexExec[1]);
                var range = parseInt(regexExec[2]);
                var irandom = random_irange(minimal, range);
                message = message.replace(regex, irandom);
            }
        }

        regex = /\$random_choose\(([A-Za-zА-Яа-я0-9]+)\)/g;
        regexExec = (regex.exec(message));
        //chat.log(regexExec);
        if (regexExec) {
            if (regexExec.length === 2) {
                var choose = regexExec[1];
                var chosen = random_choose(choose);
                //chat.log("chosen is " + chosen);
                message = message.replace(regex, chosen);
            }
        }

        if (behavior.currentBehavior === BEHAVIORS.furious) {
            message = allCaps(message);
        }
        return message;
    }

